import React, {useState, useEffect} from 'react'
import './HybridData.css'

function HybridData() {

    const [data, setData] = useState([])
    const fetchData = () => {
        fetch("https://raw.githubusercontent.com/Sreekanthm7/jsondata/main/azure-json-data/data.json")
        .then((responce) => {
            return responce.json()
        })
        .then((data) => {
            setData(data.hybridData)
        })
    }

    useEffect(() => {
        fetchData()
    }, [])
    console.log(data);

  return (
   <>
    <div className='hybrid-'>

    </div>
   </>
  )
}

export default HybridData
